-- -----------------------------------
-- Table structure for itemtemplate --
-- -----------------------------------
DROP TABLE IF EXISTS `itemtemplate`;
CREATE TABLE `itemtemplate` (
  `itemTemplateId` int(11) NOT NULL,
  `classId` int(11) NOT NULL,
  `qualityId` int(11) NOT NULL DEFAULT '0',
  `type` int(11) NOT NULL DEFAULT '0',
  `hasSellableFlag` tinyint(4) NOT NULL DEFAULT '0',
  `notTradeableFlag` tinyint(4) NOT NULL DEFAULT '0',
  `hasCharacterUniqueFlag` tinyint(4) NOT NULL DEFAULT '0',
  `hasAccountUniqueFlag` tinyint(4) NOT NULL DEFAULT '0',
  `hasBoEFlag` tinyint(4) NOT NULL DEFAULT '0',
  `boundToCharacterFlag` tinyint(4) NOT NULL DEFAULT '0',
  `notPlaceableInLockBoxFlag` tinyint(4) NOT NULL DEFAULT '0',
  `inventoryCategory` tinyint(4) NOT NULL DEFAULT '0',
  `reqLevel` int(11) NOT NULL,
  `buyPrice` int(11) NOT NULL,
  `sellPrice` int(11) NOT NULL,
  `stacksize` int(11) NOT NULL,
  `comment` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`itemTemplateId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

-- -----------------------------------------
-- Table structure for itemtemplate_armor --
-- -----------------------------------------
DROP TABLE IF EXISTS `itemtemplate_armor`;
CREATE TABLE `itemtemplate_armor` (
  `itemTemplateId` int(11) NOT NULL,
  `armorValue` int(11) NOT NULL,
  `regenRate` int(11) NOT NULL,
  `damageAbsorbed` int(11) NOT NULL,
  PRIMARY KEY (`itemTemplateId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

-- ---------------------------------------------
-- Table structure for itemtemplate_equipment --
-- ---------------------------------------------
DROP TABLE IF EXISTS `itemtemplate_equipment`;
CREATE TABLE `itemtemplate_equipment` (
  `itemTemplateId` int(11) NOT NULL,
  `slotType` int(11) NOT NULL,
  `requiredSkillId` int(11) DEFAULT NULL,
  `requiredSkillMinVal` int(11) DEFAULT NULL,
  PRIMARY KEY (`itemTemplateId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

-- ------------------------------------------
-- Table structure for itemtemplate_weapon --
-- ------------------------------------------
DROP TABLE IF EXISTS `itemtemplate_weapon`;
CREATE TABLE `itemtemplate_weapon` (
  `itemTemplateId` int(11) NOT NULL,
  `clipSize` int(11) DEFAULT NULL,
  `currentAmmo` int(11) DEFAULT NULL,
  `aimRate` float(11,2) DEFAULT NULL,
  `reloadTime` int(11) DEFAULT NULL,
  `altActionId` int(11) DEFAULT NULL,
